package arjun.dsa;

import java.util.ArrayList;
import java.util.HashMap;
import java.util.Map;
import java.util.Scanner;

/**
 * @author arjun
 */
public class QueensAttack {
  public static void main(String[] args) {
    Scanner in = new Scanner(System.in);
    long n = in.nextInt();
    long k = in.nextInt();
    long ro, co;
    ArrayList<Long> obsLeft = new ArrayList<>();
    ArrayList<Long> obsRight = new ArrayList<>();
    ArrayList<Long> obsTop = new ArrayList<>();
    ArrayList<Long> obsBottom = new ArrayList<>();
    int rQueen = in.nextInt();
    int cQueen = in.nextInt();
    ArrayList<Long> allAttacks = findAllAttacks(rQueen, cQueen, n);

    long boxIndex;
    for (int i = 0; i < k; i++) {
      ro = in.nextInt();
      co = in.nextInt();
      boxIndex = getBoxIndex(ro, co, n);
      if (!allAttacks.contains(boxIndex)) {
        continue;
      }
      if (co > cQueen) {
        obsRight.add(boxIndex);
      } else {
        obsLeft.add(boxIndex);
      }
      if (ro < rQueen) {
        obsBottom.add(boxIndex);
      } else {
        obsTop.add(boxIndex);
      }
    }
    System.out.println(allAttacks.size()
        + " "
        + obsLeft.size()
        + " "
        + obsRight.size()
        + " "
        + obsTop.size()
        + " "
        + obsBottom.size());
    int i, j, total = 0;
    for (i = rQueen, j = cQueen + 1; j <= n; j++) {
      boxIndex = getBoxIndex(i, j, n);
      if (obsRight.contains(boxIndex)) {
        obsRight.remove(boxIndex);
        break;
      }
      total++;
    }
    for (i = rQueen, j = cQueen - 1; j >= 1; j--) {
      boxIndex = getBoxIndex(i, j, n);
      if (obsLeft.contains(boxIndex)) {
        obsLeft.remove(boxIndex);
        break;
      }
      total++;
    }
    for (i = rQueen - 1, j = cQueen; i >= 1; i--) {
      boxIndex = getBoxIndex(i, j, n);
      if (obsBottom.contains(boxIndex)) {
        obsBottom.remove(boxIndex);
        break;
      }
      total++;
    }
    for (i = rQueen + 1, j = cQueen; i <= n; i++) {
      boxIndex = getBoxIndex(i, j, n);
      if (obsTop.contains(boxIndex)) {
        obsTop.remove(boxIndex);
        break;
      }
      total++;
    }
    for (i = rQueen + 1, j = cQueen + 1; i <= n && j <= n; i++, j++) {
      boxIndex = getBoxIndex(i, j, n);
      if (obsRight.contains(boxIndex)) {
        obsRight.remove(boxIndex);
        break;
      }
      total++;
    }
    for (i = rQueen - 1, j = cQueen + 1; i >= 1 && j <= n; i--, j++) {
      boxIndex = getBoxIndex(i, j, n);
      if (obsBottom.contains(boxIndex)) {
        obsBottom.remove(boxIndex);
        break;
      }
      total++;
    }
    for (i = rQueen - 1, j = cQueen - 1; i >= 1 && j >= 1; i--, j--) {
      boxIndex = getBoxIndex(i, j, n);
      if (obsLeft.contains(boxIndex)) {
        obsLeft.remove(boxIndex);
        break;
      }
      total++;
    }
    for (i = rQueen + 1, j = cQueen - 1; i <= n && j >= 1; i++, j--) {
      boxIndex = getBoxIndex(i, j, n);
      if (obsLeft.contains(boxIndex)) {
        obsLeft.remove(boxIndex);
        break;
      }
      total++;
    }
    System.out.println(total);
  }

  public static long getBoxIndex(long row, long col, long size) {
    return (row - 1) * size + col;
  }

  public static ArrayList<Long> findAllAttacks(long rQueen, long cQueen, long n) {
    long i, j, boxIndex;
    ArrayList<Long> attacks = new ArrayList<>();
    Map<Integer, ArrayList<Long>> mapping = new HashMap<>();
    for (i = rQueen, j = cQueen + 1; j <= n; j++) {
      boxIndex = getBoxIndex(i, j, n);
      attacks.add(boxIndex);
    }
    for (i = rQueen, j = cQueen - 1; j >= 1; j--) {
      boxIndex = getBoxIndex(i, j, n);
      attacks.add(boxIndex);
    }
    for (i = rQueen - 1, j = cQueen; i >= 1; i--) {
      boxIndex = getBoxIndex(i, j, n);
      attacks.add(boxIndex);
    }
    for (i = rQueen + 1, j = cQueen; i <= n; i++) {
      boxIndex = getBoxIndex(i, j, n);
      attacks.add(boxIndex);
    }
    for (i = rQueen + 1, j = cQueen + 1; i <= n && j <= n; i++, j++) {
      boxIndex = getBoxIndex(i, j, n);
      attacks.add(boxIndex);
    }
    for (i = rQueen - 1, j = cQueen + 1; i >= 1 && j <= n; i--, j++) {
      boxIndex = getBoxIndex(i, j, n);
      attacks.add(boxIndex);
    }
    for (i = rQueen - 1, j = cQueen - 1; i >= 1 && j >= 1; i--, j--) {
      boxIndex = getBoxIndex(i, j, n);
      attacks.add(boxIndex);
    }
    for (i = rQueen + 1, j = cQueen - 1; i <= n && j >= 1; i++, j--) {
      boxIndex = getBoxIndex(i, j, n);
      attacks.add(boxIndex);
    }
    return attacks;
  }
}

